  title: TANGO`S M`DANCERS
  description: SIGNS OF M`DANCERS  1. M`DANCER understands autenthicity as the following
    of its unique individuality but not to mode or to public. 2. M`DANCER attempts
    to watch itself, partner and environment through the heart, but not - the mind.
    3.  M`DANCER attempts to dances meditatively, i.e., in the relaxation, to keep
    totaly watch over, and in acceptance without nondivision. 4. M`DANCER listens
    music with heart, but not with mind. He forgets now itself as the mind. 5. M`DANCER
    dances von his unique individuality. 6. M`DANCER is approached now each moment
    spontaneous to responses to his unique individuality. 7. Body visualises now not
    only rhythm and phrasing of musics, but also its tunefulness, overtones, dynamics
    and polyphony. In the motion of bodies it is possible to see impulsiveness, plasticity,
    softness, liquidity and continuity, uncommon figures and the sequences... 8. In
    the dance of M`DANCER not to see show, demonstrativeness, making, overcoming,
    achievement... Hi is totaly absorbed in dance, moves freely and easily, as if
    playing. 9. In the dance of M`DANCERS are visible attentiveness and love for the
    partner. 10. Dance does not strain M`DANCER. His respiration remains inaudible
    and calm. I will glad to discuss with each these signs.
